import React from 'react';
import {add,sub,div,mul} from './Calc';

function App() {
    
    return (
        <>
            <div>
                <ul>
                    <li>{`sum of 2 numbers is ${add(20,3)}`}</li>
                    <li>{`difference of 2 numbers is ${sub(20,3)}`}</li>
                    <li>{`division of 2 numbers is ${div(20,4)}`}</li>
                    <li>{`multiplication of 2 numbers is ${mul(20,3)}`}</li>
                </ul>
            </div>
        </>
    );
}

export default App;
